import React from "react";
import { AppBar, Toolbar, Typography } from "@material-ui/core";
import { compare_arrows } from "@material-ui/icons";

export default () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography variant="headline" color="inherit">
          Disc Golf Disc Search Tool
        </Typography>
      </Toolbar>
    </AppBar>
  );
};
